import { useState } from 'react'
const Home = () => {

    const [item, setItem] = useState('')
    const [list, setList] = useState([])

    const handleSubmit = (e) => {
        e.preventDefault()
        let newList = [...list, item]
        setList(newList)


    }

    return(
        <div>
            <div>
                why
            {list.forEach((e, i) => {
                <div>{e}</div>
            })}
        </div>
            <form onSubmit = {handleSubmit}>
                <input 
                    type={'text'}
                    value={item}
                    onChange={e=>setItem(e.target.value)}

                />

                <input
                    type='submit'
                    value='submit'
                />
            </form>

        </div>


    )
}

export default Home
